import logo from './logo.svg';
import './App.css';
import { useState, useEffect } from "react";


function App() {

  const url = `http://api.sportradar.us/golf/trial/v3/en/players/wgr/2019/rankings.json?api_key=u7s35a5wy4w49huft39zypj9` 
  fetch(url, { 
        headers: {
          'X-Originating-IP': `70.176.211.199`

        }
      })
    .then((response) => response.json())
    .then((data) => console.log(data))




  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
